# I've provided the method below to handle Twitter's rate limiting.
# You should call this method whenever you need to access the Twitter API.
def robust_request(twitter, resource, params, max_tries=20):
    for i in range(max_tries):
        request = twitter.request(resource, params)
        if request.status_code == 200:
            return request
        else:
            print('Got error %s \nsleeping for 15 minutes.' % request.text)
            sys.stderr.flush()
            time.sleep(61 * 15)

def get_users(twitter, screen_names):
	users = []
	for screen in screen_names:
		request = robust_request(twitter, "users/lookup", {'screen_name': screen},5)
		tweets = [r for r in request]
		a_tweet = tweets[0]
		users.append(a_tweet)
	return users

def get_friends(twitter, screen_name):
	ids= []
	request = robust_request(twitter, "friends/ids", {'screen_name': screen_name, 'count':5000},5)
	friends = [r for r in request]
	for fri in friends: 
		ids.append(fri)
	ids.sort(key=int)
	return ids

