def create_graph(users, friend_counts):
    graph = nx.DiGraph()
    friend_counts = {key:val for key, val in friend_counts.items() if val != 1}
    for i in range(0,len(users)):
        g=nx.DiGraph()
        g.add_node(users[i]['screen_name'],weight=50,  with_labels=False)
        for keys in friend_counts: 
            for fri in users[i]['friends']:
                if keys == fri:
                    g.add_edge(users[i]['screen_name'],keys,weight=10, with_labels=False)
        graph=nx.compose(g,graph)
    return graph

def draw_network(graph, users, filename):
    pos6=nx.spectral_layout(graph,center=(0,0) )
    pos7=nx.spring_layout(graph,k = 1, scale=0.5, center=(0.25,-0.25) )
    nx.draw_networkx_nodes(graph,pos6,nodelist=[users[i]['screen_name'] for i in range(0,len(users))],node_color='r',node_size=100,alpha=0.8,with_labels=False)
    nx.draw_networkx_edges(graph,pos7,width=0.1,alpha=0.1)
    nx.draw_networkx_nodes(graph,pos7,node_color='r',node_size=10, with_labels=False)
    labels = {}
    for user in users:
        for node in graph.nodes():
            if str(node) in user['screen_name']:
                labels[node] = user['name']
    nx.draw_networkx_labels(graph,pos6,labels,font_size=10,font_color='black', with_labels=False)
    nx.draw_circular(graph, node_size=1,width=0.1,alpha=0.1 )
    plt.savefig(filename)
		
